import React from 'react';
import Menu from './komponenty/Menu';
import {BrowserRouter as Router,Route, Routes} from 'react-router-dom'

function App() {
  return (
    <>
    <Router>
      < Menu />
      <Routes>
        <Route path = '/' exact  />
      </Routes>
    </Router>
    </>
  );
}

export default App;
